import React from 'react';
import logo from './logo.svg';
import './App.css';
import { AuthStore } from "./contexts/AuthContext";
import { PactStore } from "./contexts/PactContext";
import Home from './components/Home';

function App() {
  return (
    <div class="App">
      <AuthStore>
        <PactStore>
          <Home />
        </PactStore>
      </AuthStore>
    </div>
  );
}

export default App;
